import React from 'react';

const Technology = () => {
  return (
    <div className="container mt-4">
      <h2>Technology Stack</h2>
      <div className="card">
        <div className="card-body">
          <h5 className="card-title">Modern Technologies</h5>
          <ul className="list-group list-group-flush">
            <li className="list-group-item">Frontend: React, Angular, Vue.js</li>
            <li className="list-group-item">Backend: Spring Boot, Node.js, Django</li>
            <li className="list-group-item">Databases: MongoDB, MySQL, PostgreSQL</li>
            <li className="list-group-item">Cloud: AWS, Azure, GCP</li>
            <li className="list-group-item">DevOps: Docker, Kubernetes, Jenkins</li>
            <li className="list-group-item">Message Brokers: Kafka, RabbitMQ</li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default Technology;
